                "description": "Hey Guys , \nThis Holi Video has every Holi situation we experience. How Indians celebrate holi . The crazy masti of Holi . Revenge wali holi , pyaar wali holi , dosto ke sath , holi fest ki holi , college wali holi , holi pool party , exams wali holi . During board exams skipping holi festival and studying whole day , Indian mom scoulding and letting go out tom play holi with friends on streets with water ballons , pichkari , herbal colors and forcing to go to tuition on Holi , deciding holi songs playlist , grooving on ap dhillon songs , enjoying bhang thandai , beer , gol gappe , dahi bhalle , gujia sweets , getting gifts from relatives gulal , rang , all the colors , pichkari , desi ghee gujia , hugging enemies sorting out the grudges , hitting with water balloons , water guns , dancing , enjoying holika dhayan , the festival of colors . Girls planning to go parlour after holi so that holi colours comes out with waxing , facial , eyebrow threading , while girl got her periods and is avoiding holi cause she can't deal with tampons , menstrual cups and pads . After marraige first holi , lakde wale in lakdi walo ke ghar , making dahi bhalle , dancing , colouring the newlyweds , new couple having their romantic holi in front of in laws , mother in law and father in law , devar , devrani , jethani , nanad all in Mom house . Planning to go out to celebrate holi with big group travelling in train bus to vrindavan , brij ki holi , jaipur , udaipur holi , mathura holi foreigners wali Holi . Society ki holi party with all the food stalls , rang , gujia , gol gappe , sweets , pickari , chandhan , bhang , kulfi . Ladies dressing like Hema malini , Rekha white suit , bandni duppata , doing holi fashion in indian traditional wear , buying Ready made gobar uple . Packing holi Gifts for Indian relatives , kids buying water guns every holi , asking more colours , discussing kodda holi of haryana . School friends deciding to play after school in school corridoor , Hiding colour packets in school bag to play holi with school friends , ruining school uniform with colours , mummy scoulding  . Chintu Chinki Bhai Behen after holi in stained holi colours Mom savitri feeding cold puri , thandi puri achar , sabzi , and tea , after bathing multiple times to get the color out , Indian family getting to bed to sleep , plans to eat faluda kulfiin the evening enjoying with a good movie . Brother going out with his bro friends again playing holi with grease . Sister telling Mom , and mom daughter freaking out  . Taking out revenge by applying colours, the foodies, getting painted first by the bf/gf, mixing pakka color into herbal colors, balloon horror created in society that we go through in holi days, and The Best Holi Fight between two groups.. Well you will love it and Relate with this video.. Enjoy and laugh out loud. \nDo Share it with everyone, Comment your fav part and like krdena Video guys.. Subscribe the Channel for more amazing videos . \nThis video is filled with such memories and situations we all have been in. \nRelish and Relive your Childhood Memories.. You will have major nostalgia\nDo share it with your friends and family  .. Comment down your Fav Part, \nLike, Share and  \n\nSubscribe to our Channel - http://bit.ly/thepaayaljain | Press Bell Icon\n\nFollow Us On Instagram \nPaayal Jain : https://www.instagram.com/thepaayalja... \n\nTena Jaiin : https://www.instagram.com/tenajaiin/?...\n\nScript By , Direction By , Screenplay By : Paayal Jain , Tena Jaiin\nDop : Imran Khan \nCam Assist : Farid Ahmad\nEditor : Sahil Arora\nThumbnail by : Shanu Jannat\n\n#happyholi #holi #holi2023 #holihai #rang #rangbarse #gulal #colors #happyholi2023 #indianmom #mom #moms #mothers #mummy #themummy #momcomedy #mummycomedy #indianaunty",
